pragma solidity ^0.4.24;

contract Patient {

    address private owner;
	// address private utilsContractAddress;


	struct Patient {
        string name;
        bytes32 password;
        string curp;
        string birthday;
        string blood;
        address createdBy;
        string genre;
        string mobile;
        string hashProfileImg;
        Diagnosis[] history;
    }

    struct Diagnosis {
        string id;  // address doctor + address patient + creationDate
        string creationDate;
        string weight;
        string height;
        string description;
        string observations;
        address createdBy;
		string hashFile;
    }

	// Relations
	mapping(address => Patient) private patients;

	mapping (address => bool) private registeredPatients;  // Patients registered

	address[] public listTotalPatients; // The list of registered patients

    // constructor(address _utilsContractAddress) public {
    constructor() public {
		owner = msg.sender;
		// utilsContractAddress = _utilsContractAddress;
	}

	// register Patients
	function registerPatient(address patientAddress, string name, string curp, string birthday,
		string blood, string mobile, string genre, string hashProfileImg, string password) public {
	    // require(doctorIsRegistered(msg.sender), "The registering Doctor is not registered");  // the doctor is registered
		require(!patientIsRegistered(patientAddress), "The Patient is already registered");  // the new patient is not already registered
		Patient storage patient = patients[patientAddress];  // get and save patient
		patient.name = name;
		patient.curp = curp;
		patient.createdBy = msg.sender;
		patient.password = keccak256(abi.encodePacked(password));// hash password
		patient.blood = blood;
		patient.birthday = birthday;
		patient.mobile = mobile;
		patient.genre = genre;
		patient.hashProfileImg = hashProfileImg;
		registeredPatients[patientAddress] = true;  // save the senders address
		listTotalPatients.push(patientAddress);
	}

	// login Patients
	function loginPatient(address addr, string password) public view returns (string) {  
		// require(doctorIsRegistered(msg.sender), "Doctor is not registered");  // check if the user is registered
		require(patientIsRegistered(addr), "Patient is not registered");  // check if the user is registered
		Patient memory patient = patients[addr];
		require(checkPassword(password, patient.password), "Invalid password");
		string memory res = string(abi.encodePacked('{', '"success":', 'true', ',"name":"', patient.name, '"}'));
		return res;
	}

	// get Patient data from address
	function getPatient(address patientAddress) public view returns (string) {  
		// require(doctorIsRegistered(msg.sender), "Doctor is not registered");  // check if the user is registered
		require(patientIsRegistered(patientAddress), "Patient is not registered");  // check if the user is registered
		Patient memory p = patients[patientAddress];
		string memory res = string(abi.encodePacked('{',
			'"address":"', addressToString(patientAddress),
			'","name":"', p.name, 
			'","curp":"', p.curp, 
			'","birthday":"', p.birthday, 
			'","blood":"', p.blood, 
			'","mobile":"', p.mobile, 
			'","genre":"', p.genre, 
			'","createdBy":"', addressToString(p.createdBy),
			'","hashProfileImg":"', p.hashProfileImg,
			'"}'));
    	return res;
	}

	// check if the patient address is already registered
	function patientIsRegistered(address addr) private view returns (bool) {
		return registeredPatients[addr];
	}

	// check password match
	function checkPassword(string password, bytes32 realPassword) internal pure returns (bool) {
	    if (keccak256(abi.encodePacked(password)) == realPassword) {
	        return true;
        }
	}

		// add Diagnosis to History of Patient
	function addDiagnosisToPatient(address patientAddress, string creationDate, string weight, 
	    string height, string description, string observations, string hashFile) public returns(string) {
	    // require(doctorIsRegistered(msg.sender), "The registering Doctor is not registered");  // the doctor is registered
		require(patientIsRegistered(patientAddress), "The Patient is not registered");  // the new patient is not already registered
		Patient storage patient = patients[patientAddress];  // get and save doctor

		// d is the new Diagnosis
		Diagnosis memory d;
		d.id = uint2hexstr(getUniqueId(patientAddress));
		d.creationDate = creationDate;
		d.weight = weight;
		d.height = height;
		d.description = description;
		d.observations = observations;
		d.createdBy = msg.sender;
		d.hashFile = hashFile;

		// push the Diagnosis to history
		patient.history.push(d);
	}

	// get History IDs by the patient address
	function getHistoryPatientByAddress(address patientAddr) public view returns (string) {  
		// require(doctorIsRegistered(msg.sender), "Doctor is not registered");  // check if the user is registered
		require(patientIsRegistered(patientAddr), "Patient is not registered");  // check if the user is registered
		Patient memory patient = patients[patientAddr];

		if (patient.history.length > 0) {
			string memory historyIds;
			historyIds = patient.history[0].id;
			for (uint i = 1; i < patient.history.length; i++) {
				historyIds = string(abi.encodePacked(historyIds, ",", patient.history[i].id));
			}
			return historyIds;
		} else {
			return "";
		}
	}

	// get Diagnosis from ID and patient address
	function getDiagnosisByIdAndAddress(string idDiagnosis, address patientAddr) public view returns (string) {  
		// require(doctorIsRegistered(msg.sender), "Doctor is not registered");  // check if the user is registered
		require(patientIsRegistered(patientAddr), "Patient is not registered");  // check if the user is registered
		Patient memory patient = patients[patientAddr];

		// TODO
		// Diagnosis memory d = patient.history[id];
		Diagnosis memory d;
		for (uint i = 0; i < patient.history.length; i++) {
		    if (keccak256(abi.encodePacked(patient.history[i].id)) == keccak256(abi.encodePacked(idDiagnosis))) {
		        d = patient.history[i];
		        break;
		    }
		}

		string memory res = string(abi.encodePacked('{',
			'"creationDate":"', d.creationDate,
			'","weight":"', d.weight, 
			'","height":"', d.height,
			'","createdBy":"', addressToString(d.createdBy),
			'","description":"', d.description,
			'","observations":"', d.observations,
			'","hashFile":"', d.hashFile,
			'"}'));

		return res;
	}

	function listPatients(address docAddress) public view returns (address[] memory) {
	    // require(doctorIsRegistered(msg.sender), "Doctor is not registered");  // check if the user is registered
		return listTotalPatients;
	}

	// Generate unique ID
    function getUniqueId(address patientAddress) internal view returns (uint) {
        // hash the msg.sender + patientAddress + date now
        bytes20 b = bytes20(keccak256(abi.encodePacked(msg.sender, patientAddress, now)));  
        uint id = 0;
        for (uint index = b.length-1; index+1 > 0; index--) {
            id += uint(b[index]) * ( 16 ** ((b.length - index - 1) * 2));
        }
        return id;
    }

	// uint to string
    function uint2hexstr(uint i) internal pure returns (string) {
        if (i == 0) return "0";
        uint j = i;
        uint length;
        while (j != 0) {
            length++;
            j = j >> 4;
        }
        uint mask = 15;
        bytes memory bstr = new bytes(length);
        uint k = length - 1;
        while (i != 0){
            uint curr = (i & mask);
            bstr[k--] = curr > 9 ? byte(55 + curr ) : byte(48 + curr); // 55 = 65 - 10
            i = i >> 4;
        }
        return string(bstr);
    }

	// Address to string
    function addressToString(address _addr) internal pure returns(string) {
        bytes32 value = bytes32(uint256(_addr));
        bytes memory alphabet = "0123456789abcdef";

        bytes memory str = new bytes(42);
        str[0] = '0';
        str[1] = 'x';
        for (uint i = 0; i < 20; i++) {
            str[2+i*2] = alphabet[uint(uint8(value[i + 12] >> 4))];
            str[3+i*2] = alphabet[uint(uint8(value[i + 12] & 0x0f))];
        }
        return string(str);
    }

	// function example() public view returns(string) {
	// 	Utils u = Utils(utilsContractAddress);
	// 	return u.example();
	// }
}

